    data: |
      SELECT - 78 + + col0 + - col0 + + 83 * + + 36 - + col0 * col2 * - ( 70 ), + 66 AS col0 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q5555.out
    data: |
      345630	66
      353960	66
      436070	66
